(17, 'Menjahit Pakaian Wanita Dewasa', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam menjahit pakaian wanita dewasa  sesuai dengan standar</span><br></p>', '[\"260 JP\"]', 'id', 43, 40, '[127,128,129,130,131,132,133,134,135,136,147,148]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,11,12', NULL, '', 1669939200, 1670112000, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(19, 'Pengoperasian Mesin Bubut', '', '<p class=\"ql-align-justify\" xss=removed>Setelah mengikuti pelatihan ini peserta kompeten</p><p class=\"ql-align-justify\" xss=removed>Membuat produk-produk manufaktur yang berkualitas, menggunakan mesin bubut, gerinda pahat dan alat potong, alat bantu/perkakas tangan, acuan gambar teknik, alat ukur yang benar, sesuai prosedur dan langkah kerja dan mengutamakan keselamatan kerja baik diri-sendiri, alat maupun lingkungannya</p><p xss=removed><br xss=removed></p>', '[\"260 JP\"]', 'id', 44, 37, '[149,150,151,152,153,154,155,156,157]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,9,10,16', NULL, '', 1670112000, 1670457600, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(20, 'Dafter CAD Mekanikal', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten membuat gambar teknik dengan menggunakan CAD (Computer Aided Drawing) yang meliputi persiapan piranti sistim CAD, pembuatan gambar-gambar 2D dan 3D, penyimpanan file serta pemanfaatan hasil gambar sesuai dengan tuntutan pekerjaan</span><br></p>', '[\"260 JP\"]', 'id', 44, 38, '[158,159,160,161,162,163,164,165,166]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,9,10,16', NULL, '', 1670112000, 1670112000, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(21, 'Practical Office Advance', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam mengoperasikan aplikasi Office Tingkat Dasar dan Tingkat Lanjut sesuai standar yang berlaku.</span><br></p>', '[\"260 JP\"]', 'id', 45, 46, '[167,168,169,170,171,172,173,174]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,7,8', NULL, '', 1670112000, 1670112000, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(22, 'Junior Desain Grafis', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam membuat karya desain dan  menggunakan aplikasi desain dengan menerapkan prinsip dasar desain</span><br></p>', '[\"260 JP\"]', 'id', 45, 47, '[175,176,177,178,179,180,181,182]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,7,8', NULL, '', 1670112000, 1670112000, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(23, 'Animator Muda', '', '<p><span xss=removed>Pelatihan ini berisikan materi untuk membuat pergerakan objek digital, membuat model digital hardsurface 3 dimensi, membuat pencitraan gambar digital (rendering), membuat komposisi teknik layer 2 dimensi (Post 2D compositing), membuat pencitraan cahaya digital, membuat pencitraan sifat permukaan (shading), membuat sudut pandang kamera 3D, membuat penyusunan artistik aset visual teknik layer 3 dimensi (Post 3D compositing), melakukan penyuntingan gambar akhir (online editing) dan membuat gambar penceritaan animasi</span><br></p>', '[\"280 JP\"]', 'id', 45, 48, '[183,184,185,186,187,188,189,190,191,192,193,194]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,7,8', NULL, '', 1670112000, 1670112000, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(24, 'Asisten Pembuat Pakaian', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta mampu menjahit dengan alat jahit tangan, menjahit dengan mesin I, melakukan penyetrikaan, memelihara alat jahit dan menerapkan prosedur K3</span><br></p>', '[\"220 JP\"]', 'id', 43, 42, '[195,196,197,198,199,200]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,11,12', NULL, '', 1670112000, 1670112000, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(25, 'Operator Garment', '', '<p><span xss=removed>Pelatihan Operator Garmen ini berdurasi 180 JP untuk mencetak tenaga operator di bidang garmen</span><br></p>', '[\"180 JP\"]', 'id', 43, 41, '[201,202,203,204,205,206]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,11,12', NULL, '', 1670112000, 1670112000, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(26, 'Teknisi Audio Video', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam Teknisi Audio Video</span><br></p>', '[\"260 JP\"]', 'id', 51, 49, '[207,208,209,210,211,212,213,214,215,216,217,218,219,220]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,13,31', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(27, 'Pemasangan Instalasi Listrik Bangunan Sederhana', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten untuk memasang PHB penerangan dan instalasi listrik bangunan sederhana untuk menghasilkan produk dalam pekerjaannya sesuai dengan standart prosedur kerja.</span><br></p>', '[\"260 JP\"]', 'id', 52, 53, '[221,222,223,224,225,226,227,228,229]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,13,31', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(29, 'Pipe Welder SMAW 6G-UP HILL/HLO-45', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam melakukan pengelasan SMAW Posisi 6 G /HLO-45 untuk menghasilkan produk yang berkualitas sesuai dengan standard yang ditentukanSetelah mengikuti pelatihan ini peserta kompeten dalam melakukan pengelasan SMAW Posisi 6 G /HLO-45 untuk menghasilkan produk yang berkualitas sesuai dengan standard yang ditentukan</span><br></p>', '[\"420 JP\"]', 'id', 54, 55, '[230,231,232,233,234,235]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,14,15,17,18', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(30, 'Plate Welder SMAW 3G-UP/PF', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam Melakukan pengelasan SMAW posisi 3G/PF Sesuai dengan Standar yang berlaku</span><br></p>', '[\"340 JP\"]', 'id', 54, 56, '[236,237,238,239,240,241]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,14,15,17,18', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(31, 'Tune Up Sepeda Motor Konvensional', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam melakukan tune up sepeda motor konvensional sesuai dengan standar operasional buku service.</span><br></p>', '[\"340 JP\"]', 'id', 57, 58, '[242,243,244,245,246,247,248,249,250,251,252,253,254,255,256,257,258]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,19,20,21,22', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
