(33, 'Teknisi AC Residential', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten Melakukan tugas pemasangan, perawatan, dan perbaikan untuk sistem atau unit tata udara rumah tangga (residential).</span><br></p>', '[\"240 JP\"]', 'id', 60, 61, '[278,279,280,281,282,283,284,285,286,287,288,289,290,291,292]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,23,24', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(34, 'Pengolahan Ikan', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten membuat produk olahan ikan berkualitas, menggunakan mesin dan alat bantu/perkakas tangan, dengan acuan gambar teknik, alat ukur yang benar, sesuai prosedur langkah kerja, dan mengutamakan keselamatan kerja baik diri-sendiri, alat maupun lingkungannya</span><br></p>', '[\"140 JP\"]', 'id', 62, 65, '[293,294,295,296,297,298,299,300,301,302,303,304]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,25,26,28', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(35, 'Pengolahan Buah', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam mengolah buah sesuai dengan standar operasional perusahaan</span><br></p>', '[\"140 JP\"]', 'id', 62, 66, '[305,306,307,308,309,310,311,312]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,25,26,28', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(36, 'Pengolahan Air Susu', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten dalam membuat produk olahan Susu yang berkualitas, menggunakan mesin dan alat bantu dengan benar sesuai dengan prosedur langkah kerja dan mengutamakan keselamatan kerja baik diri sendiri alat maupun lingkungannya.</span><br></p>', '[\"140 JP\"]', 'id', 62, 67, '[313,314,315,316,317,318,319,320,321,322]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,25,26,28', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(37, 'Pembuatan Produk Roti dan Pattiseri', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten Mengorganisir dan menyiapkan makanan, menyajikan makanan, membersihkan lokasi/ area dan peralatan, menggunakan metode dasar memasak, serta menyiapkan pastry, kue dan makanan yang mengandung ragi.</span><br></p>', '[\"280 JP\"]', 'id', 63, 64, '[323,324,325,326,327,328,329,330,331,332]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,27', NULL, '', 1670630400, 1670630400, 'general', 1, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL),
(38, 'Junior Sekretaris', '', '<p><span xss=removed>Setelah mengikuti pelatihan ini peserta kompeten  melaksanakan  pekerjaan  Junior  Sekretaris sesuai  SOP di tempat kerjanya</span><br></p>', '[\"340 JP\"]', 'id', 68, 69, '[333,334,335,336,337,338,339,340,341,342,343,344,345,346,347,348,349,350,351,352,353,354,355,356,357,358,359]', '[\"Fotocopy KTP\"]', 0, NULL, 0, 'beginner', '4,29,30', NULL, '', 1670630400, 1670630400, 'general', 0, 0, 'active', NULL, '', '', '', 1, 1, 0, 4, NULL, NULL);
