(1, 'banner_title', 'ASIYAP  KERJA'),
(2, 'banner_sub_title', 'APLIKASI LAYANAN ONLINE PENDIDIKAN DAN PELATIHAN KETERAMPILAN KERJA UPTD BALAI LATIHAN KERJA KABUPATEN SUBANG'),
(4, 'about_us', '<div xss=\"removed\"><span xss=\"removed\"><div xss=\"removed\"><br></div><div xss=\"removed\" xss=removed style=\"text-align: center; \"><b><span xss=\"removed\">VISI MISI </span></b></div><div xss=\"removed\" xss=removed style=\"text-align: center; \"><b><span xss=\"removed\">BALAI LATIHAN KERJA KABUPATEN SUBANG</span></b></div><div xss=\"removed\"><br></div><div xss=\"removed\" xss=removed style=\"text-align: center; \"><b>Visi Balai Latihan Kerja Kabupaten Subang</b></div><div xss=\"removed\" xss=removed style=\"text-align: center; \"><b><br></b></div><div xss=\"removed\" xss=removed style=\"text-align: center; \">Menjadi Lembaga Pelatihan Yang Profesional dan Berkualitas </div><div xss=\"removed\" xss=removed style=\"text-align: center; \">untuk Menciptakan Tenaga Kerja yang Kompeten dan </div><div xss=\"removed\" xss=removed style=\"text-align: center; \">Mampu Berwirausaha Mandiri di Bidangnya.</div><div xss=\"removed\"><br></div><div xss=\"removed\" style=\"text-align: center; \"><b>Misi Balai Latihan Kerja Kabupaten Subang</b></div><div xss=\"removed\" style=\"text-align: center; \">1.Meningkatkan Kualitas dan Produktivitas Tenaga Kerja; </div><div xss=\"removed\" style=\"text-align: center; \">2.Melaksanakan Pelatihan Berbasis Kompetensi dan Mobile Training Unit; </div><div xss=\"removed\" style=\"text-align: center; \">3.Melaksanakan Uji Kompetensi; </div><div xss=\"removed\" style=\"text-align: center; \">4.Menumbuhkan wirausaha mandiri yang berkesinambungan</div><div xss=\"removed\" style=\"text-align: center; \">5.Memperluas Jejaring Kerja dengan Lembaga Penempatan Kerja / Industri. </div><div xss=\"removed\" style=\"text-align: center; \">6.Meningkatkan Kinerja BLK melalui pemanfaatan Teknologi Informasi</div></span></div><div xss=\"removed\"><span xss=\"removed\"><br></span></div><div xss=\"removed\"><span xss=\"removed\"><br></span></div><div xss=\"removed\" style=\"text-align: center; \"><span xss=\"removed\"><b>SEJARAH SINGKAT </b></span></div><div xss=\"removed\" style=\"text-align: center; \"><span xss=\"removed\"><b>BALAI LATIHAN KERJA KABUPATEN SUBANG</b></span></div><div xss=\"removed\"><span xss=\"removed\"><b><br></b></span></div><div xss=\"removed\" style=\"text-align: justify; \"><span xss=\"removed\">Unit Pelaksana Teknis Daerah Balai Latihan Kerja ( UPTD BLK ) beralamat di Jl. Mayjend Sutoyo No. 48 Telp. ( 0260 ) 412655 Kabupaten Subang, dibentuk berdasarkan Keputusan Bupati Nomor 17 Tahun 2018, tanggal 29 januari 2018 yang sebelumnya merupakan UPTD Loka Latihan Kerja Usaha Kecil Menengah ( UPTD LLK UKM ) berdasarkan Peraturan Daerah  Kabupaten Subang No. 14 tahun 2001 tentang Organisasi Unit Pelaksana Teknis Dinas Kabupaten Subang.</span></div><div xss=\"removed\"><span xss=\"removed\"><br></span></div><div xss=\"removed\" style=\"text-align: justify; \"><span xss=\"removed\">Perkembangan UPTD BLK Kabupaten Subang sejak berdirinya tahun 1984 sampai tahun 2000 di tandai dengan beberapa tahap perkembangan. Pada periode tahun 1984 – 1992 UPTD LK – UKM Kabupaten Subang merupakan Bengkel Pengembangan Teknologi Tepat Guna ( BPTTG ) yang merupakan organisasi dibawah Sub – Direktorat Pembinaan Teknologi dan Pengembangan Sistem Pada Karya ( Dirjen Bina Penta ) Departemen tenaga Kerja. Berfungsi sebagai bengkel menguji coba teknologi Padat Karya dan teknologi pedesaan baik teknologi yang berasal dari luar negeri maupun dalam negeri yang merupakan sistem teknologi Padat Karya alam alih teknologi kepada para petugas lapangan teknologi sistem Padat Karya ( PL – TSPK ). Masyarakat calon pengguna dan dinas / instansi dan lembaga lain yang membutuhkan sistem Teknologi Padat Karya, yang mencakup wilayah seluruh Indonesia.</span></div><div xss=\"removed\"><span xss=\"removed\"><br></span></div><div xss=\"removed\" style=\"text-align: justify; \"><span xss=\"removed\">Seiring dengan pelaksana Undang-undang Nomor 22 tahun 1999, tentang Otonomi Daerah, mensyaratkan perubahan paradigma kepemerintahan yang ditandai dengan perubahan orientasi dari pola sentralistik menjadi desentralistik, dimana kedudukan lembaga latihan kerja yang semula berada dibawah tanggung jawab Departemen Tenaga Kerja Pusat beralih menjadi tanggung jawab Pemerintah Daerah, dalam hal ini Pemerintah Daerah Kabupaten Subang ( Perda No. 14 tahun 2001 ) tentang pembentukan Unit Pelaksana Teknis Dinas (UPTD ) Latihan Kerja Unit Kegiatan Masyarakat (LK-UKM) dan Keputusan Bupati Subang Nomor 51 tentang Tugas Pokok dan Fungsi UPTD-LKUKM Subang, kemudian ditetapkan kembali dengan Keputusan Bupati Nomor : 14G/32 Tahun 2008 tentang Tugas Pokok dan Fungsi UPTD LLK UKM Dinas Tenaga Kerja dan Transmigrasi Kabupaten Subang, dan mengalamai perubahan berdasarkan Peraturan Bupati Subang No. 17 Tahun 2018 Tanggal 29 Januari 2018 menjadi UPTD Balai Latihan Kerja Kabupaten Subang.</span></div><div xss=\"removed\"><span xss=\"removed\"><div xss=\"removed\"><br></div>'),
(10, 'terms_and_condition', '<p></p><p><span xss=\"removed\"><br></span></p><table class=\"table table-bordered\"><tbody><tr><td>NO</td><td>Perusahaan                              </td><td>Posisi dan Kualifikasi                                       <br></td><td>lnk                                    </td></tr><tr><td>1</td><td><p><span xss=\"removed\">PT. Dewasutratex II</span></p></td><td><p>Staf Produksi</p><p>Kualifikasi :</p><p>1. Teliti, bisa bekerja sama, cekatan</p><p>2. Berdomisili di Bandung, Cimahi, dan Sekitarnya</p><p xss=\"removed\"></p></td><td><p><a href=\"https://drive.google.com/file/d/1Evo_ddicpoaYJPAs9tnarYXCq-m6WkAZ/view?usp=share_link\" target=\"_blank\">DOWNLOAD</a><br></p></td></tr></tbody></table><h2><span xss=\"removed\"><br></span></h2><h2><br></h2><h2 xss=\"removed\"></h2><p></p>'),
